export function UserPage() {
    const navigate = useNavigate();
let {id} = useParams()
const userName = async ()=>{
    const data = {
        userID:id
    }
    axios.get('http://localhost:4011/log-in',id)
}

    const createPost = ()=>{
        //navigate to /new post page
        navigate('/login/userpage/newpost');
